import styled from "styled-components";

export const MainHeader = styled.header`
    position: relative;
`

export const HeaderLogo = styled.div`
    font-size: 40px;
    position: absolute;
`

export const NavigationList = styled.ul`
    display: flex;
    list-style: none;
    justify-content: right;
    margin-bottom: 20px;
`
